import { Component, OnInit } from '@angular/core';
import { SpeakerService, Event } from '../speaker.service';

@Component({
  selector: 'app-view-events',
  templateUrl: './view-events.component.html',
  styleUrls: ['./view-events.component.css']
})
export class ViewEventsComponent implements OnInit {
  events: Event[] = [];
  speakerId: number = 1; // ⚡ for now hardcoded; later replace with logged-in speakerId
  loading = false;
  errorMessage = '';

  constructor(private speakerService: SpeakerService) {}

  ngOnInit(): void {
    this.fetchEvents();
  }

  fetchEvents(): void {
    this.loading = true;
    this.errorMessage = '';
    this.speakerService.getAvailableEvents(this.speakerId).subscribe({
      next: (res) => {
        this.events = res;
        this.loading = false;
      },
      error: (err) => {
        this.errorMessage = '❌ Could not load events.';
        console.error(err);
        this.loading = false;
      }
    });
  }
}
<div class="events-container">
  <h2>Available Events</h2>

  <div *ngIf="loading" class="loading">Loading events...</div>
  <div *ngIf="errorMessage" class="error">{{ errorMessage }}</div>

  <table *ngIf="!loading && events.length > 0" class="events-table">
    <thead>
      <tr>
        <th>ID</th>
        <th>Course Title</th>
        <th>Class Size</th>
        <th>Days</th>
        <th>Start</th>
        <th>End</th>
      </tr>
    </thead>
    <tbody>
      <tr *ngFor="let ev of events">
        <td>{{ ev.eventId }}</td>
        <td>{{ ev.courseTitle }}</td>
        <td>{{ ev.classSize }}</td>
        <td>{{ ev.numberOfDays }}</td>
        <td>{{ ev.startDate | date }}</td>
        <td>{{ ev.endDate | date }}</td>
      </tr>
    </tbody>
  </table>

  <div *ngIf="!loading && events.length === 0" class="empty">
    No events available.
  </div>
</div>
